'use strict';
const cl = document.getElementsByClassName('liteoption');
if (cl.length) {
  const src = cl[0].parentElement;
  const input = document.createElement('input');
  input.type = 'submit';
  input.value = 'Trigger';
  input.onclick = function(e) {
    e.preventDefault();
    const area = document.getElementById('text_editor_textarea');

    const old = area.value;
    const cancer = alex(area.value);

    area.value += 'Hello, I am a robot! An user requested that this post be verified:\n\n';

    area.value += cancer.messages.join('\n').replace(/[`â€œ](.*?)[`â€]/g, '[b]$1[/b]');

    area.value += '\n\nMore information on this post:';

    area.value += '[table][tr][td][table]';

    area.value += '[tr][td][url=http://en.wikipedia.org/wiki/Flesch-Kincaid#Flesch.E2.80.93Kincaid_Grade_Level]Automated Readability Index[/url][/td][td]' + Readability.automatedReadability(old) + '[/td][/tr]';
    area.value += '[tr][td][url=http://en.wikipedia.org/wiki/SMOG_Index]SMOG Index[/url][/td][td]' + Readability.smog(old) + '[/td][/tr]';
    area.value += '[tr][td][url=http://en.wikipedia.org/wiki/Gunning-Fog_Index]Gunning Fog Index[/url][/td][td]' + Readability.gunningFog(old) + '[/td][/tr]';
    area.value += '[tr][td][url=http://en.wikipedia.org/wiki/Coleman-Liau_Index]Coleman-Liau Index[/url][/td][td]' + Readability.colemanLiau(old) + '[/td][/tr]';
    area.value += '[tr][td][url=http://en.wikipedia.org/wiki/Flesch-Kincaid#Flesch.E2.80.93Kincaid_Grade_Level]Flesch-Kincaid Grade Level[/url][/td][td]' + Object.values(Readability.fleschKincaid(old)) + '[/td][/tr]';

    area.value += '[/table][/td][/tr][/table]';

    //document.querySelector('[class="mainoption"]').click();
  };
  src.appendChild(input);
}
